import React from 'react'


function Shop(props) {
    
    return (
        <div>
            {props.paltar.map((index,key)=>
            <div style={{display:"inline-block"}} key={key}>
             <h1>{index.dressName}</h1>
             <h2>{index.price}AZN</h2>
             <img src={index.url} />
            </div>)
            }
        </div>
    )
}

export default Shop
